import React from "react";
import casebk from "./images/casebook_ss.jpg";
import cb from "./file/BHCG_Casebook_2022.pdf";
function casebook(){
    return (
        <div>
         <div className="cb_heading">
            <h2>Casebook</h2>
            </div>
            <div className="cb"> 
            <img src={casebk} alt="casebook image" />
            <a class="btn btn-outline-primary" href={cb} download={cb} role="button">Download</a>
         </div>
        </div>
    );
}
export default casebook;
